import { useRoutes } from 'react-router-dom';

import Header from "./components/Header";
import Home from "./screens/Home";
import UserDetails from "./screens/UserDetails";

import './App.css';

function App() {
  let element = useRoutes([
    { path: '/', element: <Home />},
    { path: '/', element: <UserDetails />},
  ]);
  return (
    <div className="App">
      <Header />
    </div>
  );
}

export default App;
